package javaclass;

public class Nameiteration {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String a="jack";
		
		for  (int i=0;i<6;i++) {
			System.out.println(a);
			
		}
		int i=0;
		while ( i<5) {
			System.out.println(a);
			
		
		do {
			i++;
			System.out.println(a);
			
		} while (i<5);
			
			
		}
	}

}
